INSERT INTO `cruse_system_news` (`ID`, `START_DATE`, `END_DATE`, `HEADLINE`, `SUMMARY`, `CONTENT`) VALUES
(4, '2011-05-19 00:00:00', '2012-03-02 00:00:00', 'Cruse App working', 'Cruse app should now be working again. Database change for new columns complete', ''),
(2, '2010-03-26 00:00:00', '2011-03-26 00:00:00', 'Data migration issues', 'All, I''m having difficulty finding infromation for carers and pre-bereavement as they both were not stored in their own field in the old database. There are a couple of enquiry outcome with a referral taken - career, and also there are quite a few referrals coming in via texts. I.e 379 out of 1700. \r\n\r\nIf you need to speak to me then call me on 07703 531825. \r\nCheers.', ''),
(1, '2010-03-01 00:00:00', '2011-03-01 00:00:00', 'Data Migrated', 'New set of data migrated. Few issues with various browsers will hopefully be fixed in the next few days', ''),
(3, '2010-06-12 00:00:00', '2010-07-12 00:00:00', 'Ethnic Origin', 'Ethnic origin is now sorted out so that categories reflect those on the yearly summary sheet and carer/PCT data is stored in the correct fields. There are still some glitches in the Religion field though - will talk to you about these next week Nicky.\r\nJaeda', '');
