(17, 3064, 'FS', '', 'Active', '2011-11-05 00:00:00', NULL, 'Wants to have support for self before joining group, so perhaps Oct/Nov. Sent letter and info 04.08.2011 suggesting that we meet before Nov meeting.\r\nFirst meeting Nov 2011\r\nAs of 01.02.2012 membership is on hold while she addresses some behaviour issues with daughter', '2011-08-04 00:00:00'),
(5, 2771, 'FS', 'Planned', 'Close', '2007-01-01 00:00:00', '2012-01-06 00:00:00', 'Daughter Emily d.o.b July 2001 (I think)\r\nDecided not to come to group any more after a lot of contemporaries stopped coming', '2006-11-09 00:00:00'),
(22, 3777, 'FS', '', 'Waiting List', NULL, NULL, 'Attending 1 to 1; twin boys have had 1 to 1 with Jaeda but are interested in the group now 1 to 1 has finished', '2012-08-09 00:00:00'),
(10, 1954, 'FS', 'Premature', 'Close', '2010-07-03 00:00:00', '2011-01-20 00:00:00', 'Attended two sessions then didn''t make any further contact. Letter sent asking her to get in touch if she needs further support.', NULL),
(12, 2835, 'SUICIDE', '', 'Waiting List', '2011-03-09 00:00:00', NULL, '', '2011-03-28 12:26:37'),
(19, 3452, 'FS', 'Premature', 'Close', NULL, '2012-05-11 00:00:00', 'To join Feb 4th - info sheet given\r\nHas not attended any sessions - spoke to her and Harley''s behaviour has improved a lot and she is not sure that he needs any extra support. She is aware that the group might be more for her support than his, but decided not to come.', '2011-01-26 00:00:00'),
