(2, 2103, 'FS', '', 'Active', '2010-06-05 00:00:00', NULL, '', NULL),
(13, 2723, 'FS', '', 'Active', '2011-09-10 00:00:00', NULL, 'Has been advised by counsellor that there may be a place available around September 2011, but no contact about group other than that.\r\n11.08.2011 - Met with Claire and sons today to talk about coming to group in September. Gave info and also I Can...You Can... cards - Jaeda\r\n\r\nAttended first group session 10.09.2011', '2011-05-12 00:00:00'),
(1, 2146, 'FS', 'Premature', 'Close', '2011-03-05 00:00:00', '2011-11-28 00:00:00', 'For three sessions in a row they said they were going to come but DNAd; were sent letter saying they are still welcome to attend but please let us know they still want to; no response', NULL),
(21, 3742, 'FS', '', 'Waiting List', NULL, NULL, 'Was due to attend in July 2012 but group was cancelled because not many families were due to attend. I spoke to Deborah and said that we would be in touch before the September group to see if she is still interested in attending, but that she could contact the office in the meantime if she wanted support (she DNAd an assessment on 27.06).', '2012-06-27 00:00:00'),
